import CentralBlock from './components/CentalBlock';
import Header from './components/header';
import Table from './components/table';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Table />
        <CentralBlock />
      </main>
    </div>
  );
}

export default App;
